import React from 'react';
import { Container, DropdownButton, Dropdown, Navbar } from "react-bootstrap";
import './Menu.css';

class Menu extends React.Component {
    constructor(props) {
        super(props);
        this.state = [{

        }]
    }

    getBrand = () => {
        axios.get("http://localhost:8081/admin/get-brands").then((res) => {
            this.setState({ brands: res.data.data });
        }).catch((error) => {
            console.log(error);
        });
    }

    render() {
        return(
            <div>
                <Navbar>
                    <Container>
                        <DropdownButton id="dropdown-basic-button" title="Brand">
                            {

                            }
                            <Dropdown.Item href="#/action-1">Samsung</Dropdown.Item>
                            <Dropdown.Item href="#/action-2">iPhone</Dropdown.Item>
                        </DropdownButton>
                    </Container>
                </Navbar>
            </div>
        );
    }
}

export default Menu;
